import ReactTypingEffect from "react-typing-effect";
interface ITypingTextProps {
  text: string;
  renderText?: (text: string, index: number) => void;
}
const TypingText: React.FC<ITypingTextProps> = props => {
  const { renderText, text = "" } = props;
  const renderTextDisplay = (text: string, index: number) => {
    return <h1>{text}</h1>;
  };
  return (
    <ReactTypingEffect
      text={text}
      displayTextRenderer={(text: string) => {
        return <h1>{text}</h1>;
      }}
    />
  );
};
export default TypingText;
